import React from 'react';
import OnepageMenu from '../components/OnepageMenu';
import ServicesBanner from '../components/Banner/ServicesBanner';


const ServiceSoftware = () => {
    return(
        <div className="body_wrapper">

                <OnepageMenu 
                    menu_txt1= "menu_txt1" 
                    menu_txt2= "menu_txt2" menu_txt3= "menu_txt3" 
                    menu_txt4= "menu_txt4" menu_txt5= "menu_txt5" 
                    menu_txt6= "menu_txt6" menu_logo= "menu_logo" />                      
                <ServicesBanner 
                    ClassC='service_1' 
                    Title='Software Development' 
                    TitleN='Services' 
                    TitleP='Our agile software development to maximize business goals.'
                    Simage='slider-software.png'/>
        </div>
    )
}
export default ServiceSoftware;
